import React from 'react';
import './Date.css';
import { doc, getDoc, serverTimestamp } from "firebase/firestore";
import { db } from '../../firebase';


// Return Date now Component 
export default function ReturndAshdAte() {

 const [now, setNow] = React.useState(null);
 React.useEffect(async () => {
  const docRef = doc(db, "ungama", "money");
  const docSnap = await getDoc(docRef);

  if (docSnap.exists()) {
   setNow(docSnap.data().delay)
  }

 }, []);

 return (
  <div className='wrp-date-trade-dash'>
   <h2>Date</h2>
   {/* <p>{now}</p> */}
   <p>{now}</p>
  </div>
 );
};
